import React from 'react'
import lendsqr from '../images/lendsqr.png'
import '../styles/navbar.scss'

const Navbar = () => {
    return (
        <div className='navbar'>
            <img className='navbar-logo' src={lendsqr} alt='lendsqr' />
        </div>
    )
}

export default Navbar
